import React from "react";
import SidebarMenu from "react-bootstrap-sidebar-menu";
import ColorLogo from "../Assets/Color logo.png";

const Sidebar = () => {
  return (
    <SidebarMenu className="">
      <SidebarMenu.Brand>
        <img src={ColorLogo} />
      </SidebarMenu.Brand>
    </SidebarMenu>
  );
};

export default Sidebar;
